import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import Scripts from './pages/Scripts';
import ScriptDetail from './pages/ScriptDetail';
import AddScript from './pages/AddScript';
import Login from './pages/Login';
import Register from './pages/Register';
import './index.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App min-h-screen flex flex-col relative gradient-bg">
          {/* 떠다니는 배경 요소들 */}
          <div className="floating-shapes">
            <div className="floating-shape w-20 h-20 top-20 left-20 float"></div>
            <div className="floating-shape w-32 h-32 top-40 right-32 float-delayed"></div>
            <div className="floating-shape w-16 h-16 top-60 left-1/3 float"></div>
            <div className="floating-shape w-24 h-24 bottom-40 right-20 float-delayed"></div>
            <div className="floating-shape w-12 h-12 bottom-60 left-40 float"></div>
            <div className="floating-shape w-28 h-28 top-80 right-1/4 float-delayed"></div>
          </div>
          
          <Navbar />
          <main className="flex-grow relative z-10">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/scripts" element={<Scripts />} />
              <Route path="/scripts/:id" element={<ScriptDetail />} />
              <Route path="/add-script" element={<AddScript />} />
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
            </Routes>
          </main>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
